def extract_clean_urls_chrome(urls):
    clean_urls = []
    for url in urls:
        # Parse l'URL
        parsed_url = urllib.parse.urlparse(url)

        # Extraire les paramètres de l'URL
        params = urllib.parse.parse_qs(parsed_url.query)

        # Ajouter l'URL propre à la liste
        clean_urls.append(params.get('url', [None])[0])

    # Retourner la liste des URL propres
    return clean_urls


